    data: |
      SELECT ALL - col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE CAST ( - + col0 AS INTEGER ) BETWEEN ( - col1 / - + 28 ) AND ( - - col1 );
  - name: tab2

outputs:
  - name: q9709.out
    data: |
